import { Component } from "react";

class Course extends Component{
    constructor(props){
        const course = props
    }
    render(){
        return(
            <div className="Course-description">
                <h2>{this.course.title}</h2>
                <p><strong>Course Code : </strong>{this.course.code}</p>
                <p><strong>Description : </strong>{this.course.description}</p>
                <p><strong>Instructor : </strong>{this.course.instructor}</p>
                <p><strong>Year : </strong>{this.course.year}</p>
            </div>
        )
    }
}
export default Course;
